import { Link } from "react-router-dom";
import '../App.css';

const Dashboard = () => {
    return (
        <>

            <nav className="App-nav">
                <Link to="/addReservation" className="addBtn">Add Reservation</Link>
                <h1>Reservation</h1>
                <span>X</span>
            </nav>
        </>
    )
};

export default Dashboard;
